import React, {useEffect, useState} from 'react';
import {useNavigate} from "react-router-dom";
import {ISalaryData} from "../types/ISalaryData";
import SalariesService from "../services/SalariesService";

const SalariesScreen = () => {
    const navigate = useNavigate();
    const [salaries, setSalaries] = useState<ISalaryData[]>([]);

    useEffect(() => {
        fetchSalaries();
    }, []);

    const fetchSalaries = () => {
        SalariesService.getAllSalaries()
            .then((response: any) => {
                setSalaries(response.data);
            })
            .catch((e: Error) => {
                console.error(e);
            })
    }

    console.log(salaries);

    return (
        <div>
            
        </div>
    );
};

export default SalariesScreen;
